sortBy on an array containing both strings and numbers gives strange results:

```
 _.sortBy([6,5,4,"hi",3,2,1])
 [1, 4, 5, 6, "hi", 2, 3]
```

I think this happens because comparison between a number and a string will coerce the string into NaN, which is neither greater than nor less than any other number:

```
 "hi">1
 false
 "hi"<1
 false
```

In my particular application I want this array to sort as [1,2,3,4,5,6,"hi"] (or even ["hi",1,2,3,4,5,6] would be acceptable). I was able to accomplish this by changing compareAscending to fall back on a stringified comparison, but I'm not sure if this is the ideal behavior in every case:

```
  function compareAscending(a, b) {
    var ac = a.criteria,
        bc = b.criteria,
        index = -1,
        length = ac.length;

    while (++index < length) {
      var value = ac[index],
          other = bc[index];

      if (value !== other) {
        if (value > other || typeof value == 'undefined') {
          return 1;
        }
        if (value < other || typeof other == 'undefined') {
          return -1;
        }
        //Begin changes
        if (String(value) > String(other)){
          return 1;
        }
        if (String(value) < String(other)){
          return -1;
        }
        //End changes
      }
    }
    // Fixes an `Array#sort` bug in the JS engine embedded in Adobe applications
    // that causes it, under certain circumstances, to return the same value for
    // `a` and `b`. See https://github.com/jashkenas/underscore/pull/1247
    //
    // This also ensures a stable sort in V8 and other engines.
    // See http://code.google.com/p/v8/issues/detail?id=90
    return a.index - b.index;
  }
```

now gives:

